function onStartConfigChoice(){$.validator.unobtrusive.parse("#frmAddEditConfigChoice")}function onSaveCategorySuccess(n){ShowMessage(n.success,n.message);n.success&&($("#configPartialView").modal("hide"),$("#tblConfigChoice").bootstrapTable("refresh"))}function openConfigChoiceModal(n){$.ajax({type:"GET",url:"ConfigChoice/AddUpdate",data:{configChoiceId:n},success:function(n){$("#configPartialView").html(n);$("#configPartialView").modal("show")}})}function addUpdateConfigChoice(n){openConfigChoiceModal(n)}function saveConfigChoice(){$("#frmAddEditConfigChoice").submit()}function deleteConfigChoice(n){confirmDialog("Are you sure?",t=>{t&&$.ajax({url:"ConfigChoice/DeleteConfigChoice",data:AddAntiForgeryToken({configChoiceId:n}),type:"POST",success:function(n){ShowMessage(n.success,n.message);n.success&&$("#tblConfigChoice").bootstrapTable("refresh")}})})}function tableConfigchoiceActions(n,t){return['<a class="like" href="javascript:void(0)" title="Edit">','<i class="fas fa-fw fa-edit" data-bookCopyId='+t.configChoiceId+'  onclick="UpdateConfigChoiceAction('+t.configChoiceId+')"><\/i>',"<\/a> ",'<a class="danger remove" href="javascript:void(0)" onclick="DeleteConfigChoiceAction('+t.configChoiceId+')"  data-toggle="modal" data-target="#VisitorDelete" title="Remove">','<i class="fas fa-trash"><\/i>',"<\/a>"].join("")}function loadConfigChoices(){$("#tblConfigChoice").bootstrapTable("refresh")}function addExtraParam(n){return n.configChoiceCategory=$("#ConfigChoiceCategoryId").val(),n}